import React, { Component } from "react";
import "./index.css";

export default class index extends Component {
  state = { mouse: false };

  render() {
    const { name, done } = this.props;
    return (
      <li>
        <label>
          <input type="checkbox" defaultChecked={done} />
          <span>{name}</span>
        </label>
        <button className="btn btn-danger" style={{ display: "none" }}>
          delete
        </button>
      </li>
    );
  }
}
